import styled from "styled-components";

export const Container = styled.div`
    background: #FFFFFF;
`;

export const HeaderButtonLeft = styled.button`
    top: 18px;
    margin-left: 10px;
    left: 10px;
    position: absolute;
    border-radius: 10px;
    border: none;
`;

export const HeaderButtonRight = styled.button`
    margin-right: 10px;
    right: 10px;
    position: absolute;
    border-radius: 10px;
    top: 18px;
    border: none;
`;

export const Title = styled.text`
    position: absolute;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-size: 16px;
    color: #1D1617;
    text-align: center;
    top: 16px;
    left: 140px;
`;

export const Container1 = styled.div`
    position: absolute;
    height: 57px;
    width: 315px;
    left: 30px;
    top: 482px;
    border-radius: 16px;
    right: 30px;
    bottom: 310px;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
    opacity: 0.2;
`;

export const Text1 = styled.text`
    position: absolute;
    left: 50px;
    right: 178px;
    top: 500px;
    bottom: 328px;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-weight: 500;
    font-size: 14px;
    line-height: 21px;
    color: #1D1617;
`;

export const Container2 = styled.div`
    position: absolute;
    width: 68px;
    height: 28px;
    left: 257px;
    right: 50px;
    top: 497px;
    bottom: 324px;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
    border-radius: 50px; 
`;

