    font-size: 16px;
    line-height: 24px;
    color: #1D1617;
`;

export const Container3 = styled.div`
    position: absolute;
    width: 315px;
    height: 93px;
    left: 30px;
    top: 608px;
    background: #FFFFFF;
    box-shadow: 0px 10px 40px rgba(29, 22, 23, 0.07);
    border-radius: 20px;
`;

export const Text4 = styled.text`
    position: absolute;
    width: 120px;
