    position: absolute;
    width: 145px;
    height: 24px;
    left: 90px;
    top: 657px;
    font-family: 'Poppins', sans-serif;
    font-style: normal;
    font-weight: 400;
    font-size: 14px;
    line-height: 24px;
    color: #7B6F72;
`;

export const Container4 = styled.div`
    position: absolute;
