    line-height: 24px;
    color: #7B6F72;
`;

export const Container5 = styled.div`
    position: absolute;
    width: 14px;
    height: 14px;
    left: 311px;
    top: 662px;
    background: #FFFFFF;
    border-radius: 10px;
`;

export const Container6 = styled.div`
    position: absolute;
    width: 14px;
    height: 14px;
    left: 311px;
    top: 770px;
    background: #FFFFFF;
